import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
export { default as GraphVisualization } from './GraphVisualization';
export { default as FraudMetrics } from '../FraudMetrics';
export { default as NodeDetails } from '../NodeDetails';
export { default as SystemMonitor } from '../SystemMonitor';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
